import './Work.css';
import Tilt from 'react-parallax-tilt'
import Nextclade from '../Nextclade.JPG'
  function Work(props) {
    return (
      <>
        <div className='work'>
          
          <p className="work-header">Work</p>
          
          <div className="web-portfolio">
              <Tilt className="parallax-effect2" 
              tiltReverse={true}
              perspective={1000}
              tiltAngleXInitial={0}
              tiltAngleYInitial={0}
              transitionSpeed={3000}
              reset={true}
              scale={1.07}
              glareEnable={true} glareMaxOpacity={0.9} glareColor="#eee3fa" glarePosition="all" glareBorderRadius="2%"
              tiltMaxAngleX={5}
              tiltMaxAngleY={5}
              gyroscope={true}
              >
              <div className="portfolio-card" style={{ backgroundImage: `url(${Nextclade}),linear-gradient(#eb01a5, #d13531)`}}> 
                <h1>Personal Portfolio</h1>
                <h2> React - GSAP - Express</h2>
              </div>
              </Tilt>
              <Tilt className="parallax-effect2" 
              tiltReverse={true}
              perspective={1000}
              tiltAngleXInitial={0}
              tiltAngleYInitial={0}
              transitionSpeed={3000}
              reset={true}
              scale={1.07}
              glareEnable={true} glareMaxOpacity={0.9} glareColor="#eee3fa" glarePosition="all" glareBorderRadius="2%"
              tiltMaxAngleX={5}
              tiltMaxAngleY={5}
              gyroscope={true}
              >
              <div className="portfolio-card">
                <h1>COVID-19 Variant Analysis</h1>
                <h2>Bash - GATK - BWA - NextClade - Pangolin</h2>
              </div>
              </Tilt>
              <Tilt className="parallax-effect2" 
              tiltReverse={true}
              perspective={1000}
              tiltAngleXInitial={0}
              tiltAngleYInitial={0}
              transitionSpeed={3000}
              reset={true}
              scale={1.07}
              glareEnable={true} glareMaxOpacity={0.9} glareColor="#eee3fa" glarePosition="all" glareBorderRadius="2%"
              tiltMaxAngleX={5}
              tiltMaxAngleY={5}
              gyroscope={true}
              >
              <div className="portfolio-card">
                <h1>Type 1 Diabietes <br></br>Three Country Cohort Analysis </h1>
                <h2> R - Kraken - Bracken - Krona - Phyloseq - AmpVis</h2>
              </div>
              </Tilt>
              <Tilt className="parallax-effect2" 
              tiltReverse={true}
              perspective={1000}
              tiltAngleXInitial={0}
              tiltAngleYInitial={0}
              transitionSpeed={3000}
              reset={true}
              scale={1.07}
              glareEnable={true} glareMaxOpacity={0.9} glareColor="#eee3fa" glarePosition="all" glareBorderRadius="2%"
              tiltMaxAngleX={5}
              tiltMaxAngleY={5}
              gyroscope={true}
              >
              <div className="portfolio-card">
                <h1>Type 1 Diabietes Three Country Cohort Anlysis </h1>
                <h2> R - Kraken - Bracken - Krona - Phyloseq - AmpVis</h2>
              </div>
              </Tilt>
          </div>
          
        </div>
        
      </>
    );
  }
  
  export default Work;
